import React from 'react';
import './App.css';

function App() {
  return (
    <div>
      <div className="row">
        <div className="col bg-danger">
          <h2 className="Get-started-with-Flyout-today text-center">
            Get started with Flyout today
          </h2>
        </div>
      </div>
    </div>
  );
}

export default App;
